package leetcode.problem438;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Solution {
    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> res = new ArrayList<>();
        int left = 0, right = 0;
        int valid = 0;
        Map<Character, Integer> need = new HashMap<>();
        Map<Character, Integer> count = new HashMap<>();
        for (int i = 0; i < p.length(); i++){
            if (need.containsKey(p.charAt(i))) need.replace(p.charAt(i), need.get(p.charAt(i))+1);
            else{
                need.put(p.charAt(i), 1);
                count.put(p.charAt(i), 0);
            }
        }
        while (right != s.length()){
            char r = s.charAt(right);
            if (need.containsKey(r)){
                count.replace(r, count.get(r) + 1);
                if (count.get(r).equals(need.get(r))){
                    valid ++;
                }
            }
            while (right - left >= p.length()-1){
                if (valid == need.size()){
                    res.add(left);
                }
                char l = s.charAt(left);
                if (need.containsKey(l)) {
                    if (count.get(l).equals(need.get(l))) {
                        valid--;
                    }
                    count.replace(l, count.get(l) - 1);
                }
                left ++;
            }
            right ++;
        }
        return res;
    }
    public List<Integer> findAnagrams1(String s, String p) {
        List<Integer> res = new ArrayList<>();
        Map<Character, Integer> count = new HashMap<>();
        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < p.length(); i++){
            if (!count.containsKey(p.charAt(i))){
                count.put(p.charAt(i), 1);
                map.put(p.charAt(i), 0);
            }
            else count.replace(p.charAt(i), count.get(p.charAt(i))+1);
        }
        int left = 0, right = 0;
        int valid = 0;
        while (right < s.length()){
            char ch = s.charAt(right);
            right ++;
            if (count.containsKey(ch)){
                map.replace(ch, map.get(ch) + 1);
                if (map.get(ch).equals(count.get(ch))){
                    valid ++ ;
                }
            }
            while (right - left >= p.length()){
                if (valid == count.size()){
                    res.add(left);
                }
                char cc = s.charAt(left);
                if (count.containsKey(cc)){
                    if (map.get(cc).equals(count.get(cc))){
                        valid --;
                    }
                    map.replace(cc, map.get(cc) - 1);
                }
                left ++;
            }
        }
        return res;
    }

    public static void main(String[] args) {
        Solution s = new Solution();
        System.out.println(s.findAnagrams("",""));
        System.out.println(s.findAnagrams("aaaabaaaa","aaaa"));
        System.out.println(s.findAnagrams("aaa", "aa"));
        System.out.println(s.findAnagrams("baa", "aa"));
        System.out.println(s.findAnagrams("cbaebabacd", "abc"));
        System.out.println(s.findAnagrams("abab", "ab"));
    }
}
